import React from 'react';

import './Back.css';

const Back = () => (
  <div className="card-back">
    <div className="card-back__content">
      <h1 className="card-back__title">PLANNING</h1>
      <h2 className="card-back__subtitle">
        <sup className="card-back__title-mark">SCRUM</sup>POKER
      </h2>
    </div>
  </div>
);

export default Back;
